import React from 'react';


class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      list: [sanjana,manish,abhijeet],
    };
  }
  render() {
    return (
      <div>
        <ul>
          {this.state.list.map(item => (
            <li key={item}>{item}</li>
          ))}
        </ul>

        <p>{this.state.name}</p>
      <p>{this.state.age}</p>
      </div>
    );
  }
}
export default App;
